import React, { FC } from 'react'

interface IPost {
    title: string;
    text: string;
    date: string;
    img: string;
    id: number;
}

const Post: FC<IPost> = ({title, text, date, img}) => {
    return (
        <div>
            <div>{title}</div>
            {text ? <div>{text}</div> : null}
            <div>{date}</div>
            <img src={img} alt="icon" />
        </div>
    )
}

export default Post
